const Todo = () => {

    const [ item, getItem, delItem ] = useState

    return(
        <>
        <button onClick={() => getItem(item)}>할 일 추가</button>
        <button onClick={() => delItem(item)}>할 일 삭제</button>
        </>
    )
}

export default Todo
